import React from 'react';
import { Card, CardContent, Typography, Box, Grid, Table, TableBody, TableCell, TableContainer, TableHead, TableRow } from '@mui/material';
import { BarChart } from '@mui/x-charts/BarChart';
import { LineChart } from '@mui/x-charts/LineChart';
import { PieChart } from '@mui/x-charts/PieChart';

const ProjectionsChart = () => {
  const data = [20, 35, 25, 45, 30, 40, 35, 50, 45, 35, 40, 30];
  const xLabels = ['Jan', 'Feb', 'Mar', 'Apr', 'May', 'Jun', 'Jul', 'Aug', 'Sep', 'Oct', 'Nov', 'Dec'];

  return (
    <Card sx={{ height: 300 }}>
      <CardContent sx={{ p: 2.5, height: '100%' }}>
        <Typography variant="body1" sx={{ mb: 2, fontWeight: 600, fontSize: '1rem' }}>
          Projections vs Actuals
        </Typography>
        <Box sx={{ height: 220, width: '100%' }}>
          <BarChart
            series={[{ data, color: '#3b82f6' }]}
            xAxis={[{ data: xLabels, scaleType: 'band', tickLabelStyle: { fontSize: 12 } }]}
            height={220}
            margin={{ left: 20, right: 20, top: 20, bottom: 30 }}
            slotProps={{
              bar: {
                rx: 4,
              },
            }}
          />
        </Box>
      </CardContent>
    </Card>
  );
};

const RevenueChart = () => {
  const currentWeek = [20, 25, 30, 35, 40, 45, 50, 55, 60, 65, 70, 75];
  const previousWeek = [15, 20, 25, 30, 35, 40, 45, 50, 55, 60, 65, 70];
  const xLabels = ['Jan', 'Feb', 'Mar', 'Apr', 'May', 'Jun', 'Jul', 'Aug', 'Sep', 'Oct', 'Nov', 'Dec'];

  return (
    <Card sx={{ height: 300 }}>
      <CardContent sx={{ p: 2.5, height: '100%' }}>
        <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'flex-start', mb: 2 }}>
          <Typography variant="body1" sx={{ fontWeight: 600, fontSize: '1rem' }}>
            Revenue
          </Typography>
          <Box sx={{ display: 'flex', gap: 2, fontSize: '0.75rem' }}>
            <Box sx={{ textAlign: 'right' }}>
              <Typography variant="caption" color="text.secondary" sx={{ fontSize: '0.7rem' }}>
                Current Week
              </Typography>
              <Typography variant="body2" fontWeight={600} sx={{ fontSize: '0.8rem' }}>
                $58,211
              </Typography>
            </Box>
            <Box sx={{ textAlign: 'right' }}>
              <Typography variant="caption" color="text.secondary" sx={{ fontSize: '0.7rem' }}>
                Previous Week
              </Typography>
              <Typography variant="body2" fontWeight={600} sx={{ fontSize: '0.8rem' }}>
                $68,768
              </Typography>
            </Box>
          </Box>
        </Box>
        <Box sx={{ height: 220, width: '100%' }}>
          <LineChart
            series={[
              { data: currentWeek, color: '#000000', curve: 'linear' },
              { data: previousWeek, color: '#d1d5db', curve: 'linear' },
            ]}
            xAxis={[{ data: xLabels, scaleType: 'band', tickLabelStyle: { fontSize: 12 } }]}
            height={220}
            margin={{ left: 20, right: 20, top: 20, bottom: 30 }}
          />
        </Box>
      </CardContent>
    </Card>
  );
};

const LocationChart = () => {
